// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract OperadorRelacional {
    uint16 public a = 10;
    uint16 public b = 30;

    function equal() public view returns (bool) {
        return a == b;
    }

    function notEqual() public view returns (bool) {
        return a != b;
    }

    function greaterThan() public view returns (bool) {
        return a > b;
    }

    function lessThan() public view returns (bool) {
        return a < b;
    }

    function greaterOrEqual() public view returns (bool) {
        return a >= b;
    }

    function lessOrEqual() public view returns (bool) {
        return a <= b;
    }
}

